import React from 'react'

const StackBtn = (props)=> {

    const hoverPop = (e) => {
        e.popover()
    }

    let name = props.name.toLowerCase()

    switch (name) {
        case "node":
            name = 'nodejs'
            break;
        case "golang":
            name = 'go'
            break;
        default:
            break;
    }

    return (
      <div className={`stack-btn mr-2 mb-1`}>
        <i onMouseEnter={(e)=> hoverPop(e)} data-toggle="popover" data-content={props.name} data-trigger="hover" className={`devicon-${name.toLowerCase()}-plain stack-${name.toLowerCase()}`}></i>
      </div>
    );
}

export default StackBtn
